import React from 'react';
import Navbar from './Navbar';
import './homepage.css';

function Homepage()
{
    return(
        <div>
            <Navbar/>

        <div class="container">
       <div class="item item-1"> <h3> processor</h3></div>
       <div class="item item-2"> <h3> motherboard</h3></div>
       <div class="item item-3"> <h3> keyboard</h3></div>
       <div class="item item-4"> <h3> screen</h3></div>
       <div class="item item-5"> <h3> gpu</h3></div>
       <div class="item item-6"> <h3> speakers</h3></div>
      </div>
        </div>
    );
}

export default Homepage;
